import {Table, Form } from 'react-bootstrap';
import {React} from 'react';
import Row from './rows';
const object=[<tr>
    <td> <Form.Control type="text" /></td>
    <td><Form.Control type="number" /></td>
    <td><Form.Control type="number" /></td>
    <td><Form.Control type="number" /></td>
    </tr>]
const app =() =>{
return(    
    <Table striped bordered hover>
    <thead>
      <tr>
        <th>Course</th>
        <th>Credit Weight</th>
        <th>Grade</th>
        <th>Grade Point Value</th>
      </tr>
    </thead>
    <tbody>
    <Row object={object}/>
</tbody>
  </Table>
        
     
    );
}

export default app;
